import * as React from 'react';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Link from '@mui/material/Link';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import Typography from '@mui/material/Typography';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { useDispatch } from "react-redux";
import { useNavigate } from "react-router-dom";
import { register } from "../../services/userService";
import Select from '@mui/material/Select';
import MenuItem from '@mui/material/MenuItem';
import { FormControl, InputLabel, Menu } from '@mui/material';
import ArrowDropDownIcon from '@mui/icons-material/ArrowDropDown';



const defaultTheme = createTheme();

export default function Register({ setLogin }) {
    const [username, setUsername] = React.useState("")
    const [password, setPassword] = React.useState("")
    const [telephone, setTelephone] = React.useState("")
    const [role, setRole] = React.useState("Người dùng")
    const [anchorEl, setAnchorEl] = React.useState(null);



    const changeLogin = () => {
        setLogin(true)
    }

    const handleStatusClick = (event) => {
        setAnchorEl(event.currentTarget);
    };

    const handleStatusClose = (newRole) => {
        setAnchorEl(null);
        if (newState) {
            setRole(newStatus);
        }
    };

    const dispatch = useDispatch();
    const handleRegister = async () => {
        let userData = { username, password, telephone, role }
        console.log(userData);
        await dispatch(register(userData));

    }
    return (

        <ThemeProvider theme={defaultTheme}>
            <CssBaseline />
            <Grid
                item
                xs={false}
                sm={4}
                md={7}
                sx={{
                    backgroundImage: 'url(https://source.unsplash.com/random?wallpapers)',
                    backgroundRepeat: 'no-repeat',
                    backgroundColor: (t) =>
                        t.palette.mode === 'light' ? t.palette.grey[50] : t.palette.grey[900],
                    backgroundSize: 'cover',
                    backgroundPosition: 'center',
                }}
            />
            <Box
                className="form-register"
                sx={{
                    my: 8,
                    mx: 4,
                    display: 'flex',
                    flexDirection: 'column',
                    alignItems: 'center',
                }}
            >
                <div className="form-register-user">
                    <Avatar sx={{ m: 1, width: "50px", height: "50px", margin: "auto" }}>
                        <img src="logo.png" style={{ width: "50px", height: "50px", borderRadius: "50%" }} />
                    </Avatar>
                    <Typography component="h1" variant="h5">
                        Register
                    </Typography>
                    <Box component="form" sx={{ mt: 1 }}
                    >
                        <TextField
                            margin="normal"
                            required
                            id="username"
                            label="Username"
                            name="username"
                            autoComplete="username"
                            autoFocus
                            sx={{ width: "300px" }}
                            value={username}
                            onChange={(e) => {
                                setUsername(e.target.value)
                            }}
                        />
                        <TextField
                            margin="normal"
                            required
                            name="password"
                            label="Password"
                            type="password"
                            id="password"
                            autoComplete="current-password"
                            sx={{ width: "300px" }}
                            value={password}
                            onChange={(e) => {
                                setPassword(e.target.value)
                            }}
                        />
                        <TextField
                            margin="normal"
                            required
                            name="telephone"
                            label="Telephone"
                            type="tel"
                            id="telephone"
                            autoComplete="off"
                            sx={{ width: "300px" }}
                            value={telephone}
                            onChange={(e) => {
                                setTelephone(e.target.value)
                            }}

                        />
                        <Button
                            variant="contained"
                            style={{ backgroundColor: '#F1F1F1', color: 'black', margin: "10px 0 0 0" }}
                            onClick={handleStatusClick}
                            endIcon={<ArrowDropDownIcon />}
                        >
                            Role: {role}
                        </Button>
                        <Menu
                            anchorEl={anchorEl}
                            open={Boolean(anchorEl)}
                            onClose={() => handleStatusClose(null)}
                        >
                            <MenuItem onClick={() => handleStatusClose('public')}>Public</MenuItem>
                            <MenuItem onClick={() => handleStatusClose('private')}>Private</MenuItem>
                        </Menu>


                        <FormControlLabel
                            control={<Checkbox value="remember" color="primary" />}
                            label="Remember me"
                        />

                        <Button
                            type="button"
                            variant="contained"
                            sx={{ mt: 3, mb: 2, width: "300px" }}
                            onClick={handleRegister}
                        >
                            Register
                        </Button>
                        <Grid container>
                            <Grid item>
                                <Link variant="body2" onClick={changeLogin}>
                                    {"Do you already have an account? Login"}
                                </Link>
                            </Grid>
                        </Grid>
                    </Box>
                </div>
            </Box>
        </ThemeProvider>
    );
}
